// Explains design principles in Gen Z friendly language
function explainPrinciple(principle, context, skillLevel) {
  const explanations = {
    hierarchy: {
      beginner: "Think of hierarchy like your Instagram feed - your eye goes to the biggest, boldest thing first",
      intermediate: "Visual hierarchy guides the user's eye through your design in order of importance"
    }
  }
}

// Analyzes submission context and extracts key details
function analyzeSubmission(description, projectType, skillLevel) {
  return {
    projectGoals: extractedGoals,
    designChallenges: identifiedChallenges,
    skillGaps: assessedGaps,
    industryContext: relevantContext
  }
}

// Get the extracted website data
const extractedData = $input.all()[0].json;

// Initialize analysis object
const analysis = {
  title_analysis: {
    title: extractedData.page_title || '',
    length: (extractedData.page_title || '').length,
    seo_optimized: false,
    issues: []
  },

  meta_analysis: {
    description: extractedData.meta_description || '',
    length: (extractedData.meta_description || '').length,
    seo_optimized: false,
    issues: []
  },

  accessibility_scan: {
    total_images: 0,
    images_with_alt: 0,
    images_without_alt: 0,
    alt_text_quality: 'unknown',
    issues: []
  },

  content_structure: {
    headings: extractedData.headings || [],
    h1_count: 0,
    heading_hierarchy_issues: [],
    content_quality: 'unknown'
  },

  technical_issues: [],
  overall_score: 0,
  recommendations: []
};

// Analyze title
if (analysis.title_analysis.title) {
  if (analysis.title_analysis.length < 30) {
    analysis.title_analysis.issues.push('Title too short (under 30 characters)');
  } else if (analysis.title_analysis.length > 60) {
    analysis.title_analysis.issues.push('Title too long (over 60 characters)');
  } else {
    analysis.title_analysis.seo_optimized = true;
  }
} else {
  analysis.title_analysis.issues.push('Missing page title');
  analysis.technical_issues.push('No page title found');
}

// Analyze meta description
if (analysis.meta_analysis.description) {
  if (analysis.meta_analysis.length < 120) {
    analysis.meta_analysis.issues.push('Meta description too short (under 120 characters)');
  } else if (analysis.meta_analysis.length > 160) {
    analysis.meta_analysis.issues.push('Meta description too long (over 160 characters)');
  } else {
    analysis.meta_analysis.seo_optimized = true;
  }
} else {
  analysis.meta_analysis.issues.push('Missing meta description');
  analysis.technical_issues.push('No meta description found');
}

// Analyze images and accessibility
if (extractedData.images && Array.isArray(extractedData.images)) {
  analysis.accessibility_scan.total_images = extractedData.images.length;

  // Count images with meaningful content (filter out empty strings)
  const meaningfulImages = extractedData.images.filter(img => img && img.trim().length > 0);
  analysis.accessibility_scan.total_images = meaningfulImages.length;

  // Note: In a real implementation, you'd parse alt attributes from img tags
  // For now, we'll provide general accessibility guidance
  if (analysis.accessibility_scan.total_images > 0) {
    analysis.accessibility_scan.issues.push(`Found ${analysis.accessibility_scan.total_images} images - ensure all have descriptive alt text`);
    analysis.recommendations.push('Review all images for proper alt text descriptions');
  }
}

// Analyze heading structure
if (analysis.content_structure.headings && Array.isArray(analysis.content_structure.headings)) {
  const headings = analysis.content_structure.headings;

  // Count H1s (assuming headings contain the actual text, not HTML)
  // In a more sophisticated version, you'd parse HTML to get heading levels
  const uniqueHeadings = [...new Set(headings)];
  analysis.content_structure.h1_count = uniqueHeadings.length > 0 ? 1 : 0; // Simplified

  if (uniqueHeadings.length === 0) {
    analysis.content_structure.heading_hierarchy_issues.push('No headings found');
    analysis.technical_issues.push('Missing heading structure');
  } else if (uniqueHeadings.length === 1) {
    analysis.content_structure.heading_hierarchy_issues.push('Only one unique heading found - may lack content hierarchy');
  }

  // Check for content quality indicators
  const totalHeadingText = headings.join(' ').toLowerCase();
  if (totalHeadingText.includes('design') || totalHeadingText.includes('portfolio') || totalHeadingText.includes('creative')) {
    analysis.content_structure.content_quality = 'design_focused';
  }
}

// Calculate overall score
let score = 0;
if (analysis.title_analysis.seo_optimized) score += 25;
if (analysis.meta_analysis.seo_optimized) score += 25;
if (analysis.accessibility_scan.total_images === 0 || analysis.accessibility_scan.issues.length === 0) score += 25;
if (analysis.content_structure.heading_hierarchy_issues.length === 0) score += 25;
analysis.overall_score = score;

// Generate recommendations based on issues
if (analysis.title_analysis.issues.length > 0) {
  analysis.recommendations.push('Optimize page title for SEO (30-60 characters, descriptive)');
}
if (analysis.meta_analysis.issues.length > 0) {
  analysis.recommendations.push('Add compelling meta description (120-160 characters)');
}
if (analysis.technical_issues.includes('Missing heading structure')) {
  analysis.recommendations.push('Implement proper heading hierarchy (H1, H2, H3)');
}

// Prepare context for AI
const aiContext = {
  website_analysis: analysis,
  extracted_data: {
    page_title: extractedData.page_title,
    meta_description: extractedData.meta_description,
    image_count: analysis.accessibility_scan.total_images,
    unique_headings: analysis.content_structure.headings ? [...new Set(analysis.content_structure.headings)] : []
  },
  analysis_summary: {
    seo_score: `${analysis.overall_score}/100`,
    main_issues: analysis.technical_issues,
    key_recommendations: analysis.recommendations.slice(0, 3), // Top 3 recommendations
    content_type: analysis.content_structure.content_quality
  }
};

// Return the analysis
return [{ 
  json: {
    website_analysis: aiContext,
    raw_extraction: extractedData,
    analysis_timestamp: new Date().toISOString()
  }
}];

// Input classification logic for Smart Router
const submissionData = $input.all()[0].json;
const files = submissionData.files || [];
const projectDescription = submissionData.projectDescription || "";
const designerName = submissionData.designerName || "";

// File type classification
const fileTypes = files.map(file => {
  if (file.type?.includes('image')) return 'image';
  if (file.name?.endsWith('.fig')) return 'figma';
  if (file.type?.includes('pdf')) return 'pdf';
  return 'other';
});

// Project type classification (based on description keywords)
const projectType = classifyProjectType(projectDescription);
const skillLevel = inferSkillLevel(projectDescription, designerName);
const hasMultipleFiles = files.length > 1;

function classifyProjectType(description) {
  const desc = description.toLowerCase();
  if (desc.includes('website') || desc.includes('web design') || desc.includes('landing')) return 'web';
  if (desc.includes('mobile') || desc.includes('app') || desc.includes('ios') || desc.includes('android')) return 'mobile';
  if (desc.includes('logo') || desc.includes('brand') || desc.includes('identity')) return 'branding';
  if (desc.includes('portfolio') || desc.includes('multiple') || desc.includes('series')) return 'portfolio';
  if (desc.includes('print') || desc.includes('poster') || desc.includes('brochure')) return 'print';
  return 'general';
}

function inferSkillLevel(description, designerName) {
  const text = (description + ' ' + designerName).toLowerCase();
  if (text.includes('student') || text.includes('beginner') || text.includes('learning')) return 'beginner';
  if (text.includes('senior') || text.includes('lead') || text.includes('director')) return 'advanced';
  return 'intermediate';
}

// Output routing data
return {
  originalData: submissionData,
  classification: {
    fileTypes,
    projectType,
    skillLevel,
    hasMultipleFiles,
    routingPath: determineRoutingPath(fileTypes, projectType, hasMultipleFiles)
  }
};

function determineRoutingPath(fileTypes, projectType, hasMultipleFiles) {
  if (hasMultipleFiles) return 'portfolio';
  if (fileTypes.includes('figma')) return 'figma';
  if (projectType === 'web') return 'web';
  return 'standard'; // Your current path
}

const routerData = $input.all()[0].json;

// Only process if this is file upload route
if (routerData.route !== 'file_upload') {
  return [{ json: { 
    skip_file_processing: true,
    route: routerData.route,
    submission_data: routerData.submission_data
  }}];
}

const submissionData = routerData.submission_data;
const files = submissionData.files || [];

// Process file information
const processedFiles = files.map((file, index) => {
  // Extract file information
  const fileName = file.filename || `file_${index}`;
  const fileType = file.mimetype || 'unknown';
  const fileSize = file.size || 0;

  // Determine if it's an image
  const isImage = fileType.startsWith('image/') || 
                  fileName.toLowerCase().match(/\.(jpg|jpeg|png|gif|bmp|webp|svg)$/);

  // Determine if it's a PDF
  const isPDF = fileType === 'application/pdf' || fileName.toLowerCase().endsWith('.pdf');

  return {
    index: index,
    filename: fileName,
    type: fileType,
    size: fileSize,
    is_image: isImage,
    is_pdf: isPDF,
    file_data: file.data || file.content, // The actual file content
    analysis_priority: isImage ? 'high' : isPDF ? 'medium' : 'low'
  };
});

// Filter to only analyze images and PDFs
const analyzableFiles = processedFiles.filter(file => file.is_image || file.is_pdf);

return [{ json: {
  route: 'file_upload',
  total_files: files.length,
  analyzable_files: analyzableFiles,
  file_analysis_needed: analyzableFiles.length > 0,
  submission_data: submissionData
}}];

// Get the uploaded files from the previous node
const uploadedFiles = $json.analyzable_files || [];

// Start building the content array with the text prompt
const content = [
  {
    type: "text",
    text: `Analyze these ${uploadedFiles.length} design image${uploadedFiles.length > 1 ? 's' : ''} with the expertise of a senior graphic design instructor. Focus on:

VISUAL HIERARCHY & COMPOSITION:
- Typography choices, sizing, and placement
- Visual balance and focal points
- Use of white space and layout
- Overall compositional strength

COLOR & VISUAL ELEMENTS:
- Color palette effectiveness and harmony
- Contrast and readability
- Visual style and aesthetic cohesion
- Technical execution quality

DESIGN PRINCIPLES APPLICATION:
- How well are fundamental design principles applied?
- What works well in each design?
- What specific areas need improvement?
- How could these be refined or enhanced?

${uploadedFiles.length > 1 ? 'Compare the images and note how they work together as a series.' : ''} Provide specific, actionable feedback that would help a graphic design student improve their work. Be encouraging but honest about areas for growth.`
  }
];

// Add each uploaded image to the content array
uploadedFiles.forEach((file, index) => {
  content.push({
    type: "image",
    source: {
      type: "base64",
      media_type: $input.first().json.submission_data.files[0].mimetype,
      data: $input.first().json.submission_data.files[0].base64         
    }
  });
});

// Return the formatted JSON for Claude's API
return {
  json: {
    model: "claude-3-sonnet-20240229",
    max_tokens: 2000,
    messages: [
      {
        role: "user",
        content: content
      }
    ]
  }
};

const visionResponse = $input.all()[0].json;

// Extract the analysis text from Claude's response
const analysisText = visionResponse.content && visionResponse.content[0] 
  ? visionResponse.content[0].text 
  : 'Vision analysis failed';

// Structure the analysis for The Crit Machine
const structuredAnalysis = {
  visual_analysis: {
    raw_feedback: analysisText,
    analysis_quality: 'high',
    has_specific_observations: analysisText.length > 100,
    token_usage: visionResponse.usage || {}
  },

  submission_context: {
    analysis_type: 'visual_design_critique',
    has_visual_analysis: true,
    analysis_timestamp: new Date().toISOString()
  }
};

// Prepare enhanced context for The Crit Machine
const enhancedContext = `
VISUAL ANALYSIS COMPLETED:
An AI vision system has analyzed the uploaded design files and provided detailed observations.

VISUAL ANALYSIS RESULTS:
${analysisText}

SYNTHESIS INSTRUCTIONS:
- Review the visual observations above for accuracy and relevance
- Build upon these observations with your design expertise
- Structure the feedback into your standard educational format
- Add design principle context and learning guidance
- Ensure the tone remains encouraging and growth-oriented
- Reference specific visual elements identified in the analysis
- Provide actionable next steps based on the observations
`;

return [{ json: {
  enhanced_context: enhancedContext,
  structured_analysis: structuredAnalysis,
  vision_feedback: analysisText,
  ready_for_crit_machine: true
}}];
